import { Component, OnInit } from '@angular/core';
import { UserGet  } from './services/user.service';
import { IUser, User } from './models/interfaces';


@Component({
  selector: 'page',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.less']
})

export class AppComponent implements OnInit{
  title = "АлексБибл"
  user : IUser = new User()

  constructor(private userData : UserGet){}

  ngOnInit(): void {
    this.userData.GetUserData("6").subscribe(user => {
      this.user = user
    })
  }
}
